import { Component } from '@angular/core';
import { FormGroup, FormBuilder, Validators } from '@angular/forms';

@Component({
  selector: 'app-add-pet',
  templateUrl: './add-pet.component.html',
  styleUrls: ['./add-pet.component.css']
})
export class AddPetComponent {
  newForm: FormGroup; // Define FormGroup for the form

  constructor(private formBuilder: FormBuilder) {
    // Initialize the form structure and validation rules
    this.newForm = this.formBuilder.group({
      name: ['', Validators.required],
      petType: ['', Validators.required],
      petBreed: ['', Validators.required],
      ownerId: ['', Validators.required] // Assuming ownerId is selected from a list of owners
    });
  }

  onSubmit(): void {
    // Implement submission logic here, e.g., save to backend or perform other actions
    if (this.newForm.valid) {
      console.log('Form submitted:', this.newForm.value);
      // Reset the form after submission
      this.newForm.reset();
    } else {
      // Mark all fields as touched to display validation errors

    }
  }

  // Convenience getter for easy access to form fields in the template
  get form() { return this.newForm.controls; }
}
